import React , {Component} from 'react';
class Items extends Component{
    
    render(){
   
        const {my_id , my_name , my_age} = this.props;
        
        return(
           <div>
            <p>{my_id}</p>
            <p>{my_name}</p>
            <p>{my_age}</p>
            </div>
        )
    }
}
export default Items;
